import { TextField } from "@mui/material";
import React from "react";

function ItemCreationList() {
  return (
    <div className="pt-5 text-center">
      <h1>Item Creation List</h1>
      <div className="flex justify-between whitespace-nowrap ite">
        <TextField
          size="small"
          label="Search By Item Name/Item Code"
          fullWidth
        />
        <div>
          <button className="bg-indigo-900 text-white rounded h-9 px-3">
            Add +
          </button>
        </div>
      </div>
    </div>
  );
}

export default ItemCreationList;
